def calculate_gravity(height, time_values, air_resistance_coefficient=0):
    """"""
    g_values = []
    for time in time_values:
        g0 = 2 * height / time ** 2
        g = g0 * (1 - air_resistance_coefficient * time ** 2)
        g_values.append(g)
    return sum(g_values) / len(g_values)
